import { Button, Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow } from '@mui/material';
import {siteNo} from '../api/keywordJob'
import { useEffect, useState } from 'react';
import KeywordRegistStatusList, { KeywordJobStatusMap } from '../constants/KeywordRegistStatusList';

export default function KeywordCheckTable(){
    interface DataItem{
        createdAt: string,
        mediaName: number,
        type: number,
        name: number,
        status: number,
        startAt:string,
        endAt:string,
        fileName:string,
        createdBy:string,
        typeText:string,
        statusText:string,
        timetrim:string,
    }
    const [data, setData] = useState<DataItem[]>([]);
    useEffect(() => {
        const fetchData = async () => {
          try {
            const response = await siteNo()
            const users: any = response.data;
            const contents: any[] = users.content;
            console.log(contents);
            const getStatusText = (status: string): string => {
                const matchedStatus = KeywordJobStatusMap[status];
                console.log(matchedStatus);
                return matchedStatus ? matchedStatus.text : "";
              };
            const processedData = contents.map((item: any) => {
                const statusText = getStatusText(item.status);
                const formattedStatus = item.createAt.replace('T', ' ').trim();
                const matchedtype = KeywordRegistStatusList.find(
                  (status) => status.value === item.type
                );
                const typeText = matchedtype ? matchedtype.text : ""; 
                return {
                  createdAt: item.createdAt,
                  mediaName: item.mediaName,
                  type: item.type,
                  name: item.name,
                  status: item.status,
                  startAt: item.startAt,
                  endAt: item.endAt,
                  fileName: item.keywordJobNo,
                  createdBy: item.createdBy,
                  typeText: typeText,
                  statusText:statusText,
                  timetrim:formattedStatus
                };
              });

              setData(processedData);
          } catch (error) {
            console.error('삐빅삐빅 에러입니다:', error);
          }
        };
        fetchData();
      }, []);

    return(
        <div style={{ height: 600, width: '95%',marginLeft:'40px'}}>
            <TableContainer component={Paper}>
            <Table sx={{ minWidth: 650 }} aria-label="simple table">
                <TableHead>
                <TableRow>
                    <TableCell>신청일</TableCell>
                    <TableCell align="right">광고상품</TableCell>
                    <TableCell align="right">작업구분</TableCell>
                    <TableCell align="right">작업명</TableCell>
                    <TableCell align="right">작업상태</TableCell>
                    <TableCell align="right">수행시작</TableCell>
                    <TableCell align="right">수행종료</TableCell>
                    <TableCell align="right">등록파일</TableCell>
                    <TableCell align="right">결과</TableCell>
                    <TableCell align="right">대기취소</TableCell>
                    <TableCell align="right">요청자</TableCell>
                </TableRow>
                </TableHead>
                <TableBody>
                {data.map((item) => (
                    <TableRow
                    key={item.createdAt}
                    sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                    >
                    <TableCell align="right">{item.createdAt}</TableCell>
                    <TableCell align="right">{item.mediaName}</TableCell>
                    <TableCell align="right">{item.typeText}</TableCell>
                    <TableCell align="right">{item.name}</TableCell>
                    <TableCell align="right">{item.statusText}</TableCell>
                    <TableCell align="right">{item.startAt}</TableCell>
                    <TableCell align="right">{item.endAt}</TableCell>
                    <TableCell align="right">
                        <Button variant="outlined" color="error">다운로드</Button>
                    </TableCell>
                    <TableCell align="right">
                        <Button variant="outlined" color="error">다운로드</Button>
                    </TableCell>
                    <TableCell align="right">
                    <Button variant="contained" disabled>취소</Button>
                    </TableCell>
                    <TableCell align="right">{item.createdBy}</TableCell>
                    </TableRow>

                ))}
                </TableBody>
            </Table>
            </TableContainer>
      </div>
    );
}
